import { useState } from 'react';
import { useLocation } from 'react-router-dom';
import back from './coin-back.svg';
import front from './coin-front.svg';
import './Game.css';

function Game(props) {
    const location = useLocation()
    const { name, bet, side } = location.state;
    const [flipState, setFlipState] = useState(0);

    console.log(name, bet, side);

    return (
        <div>
            <button onClick={() => setFlipState(flipState + 1)}>next</button>
            <img className="coin-flip" id={"coin-back-" + flipState.toString()} width={300} height={300} src={back} alt="coin" />
            <img className="coin-flip" id={"coin-front-" + flipState.toString()} width={300} height={300} src={front} alt="coin" />
            {/* <img className="coin-flip" id="coin-side" width={500} height={500} src={coinSide} alt="coin" /> */}
        </div>
    );
}

export default Game;
